css:
@-moz-document url-prefix(https://twitter.com) {
  h1 > a[href="/home"] > div:after {
    content:'ander de Buisonjé'; 
    color: #1d9bf0;
  }
  @media (prefers-color-scheme: dark) {
    h1 > a[href="/home"] > div:after {
      color: white;
    }
  }
}

